query GetTemplateMenuSummary($templateId: String!, $input: StoreConfigurationSummaryInput!) {
  menuTemplate(id: $templateId) {
    ...MenuTemplateSummaryFields
    parentEntities {
      ... on Brand {
        id
        name
        permissions {
          brandMenuPermissions {
            canEditMenu
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    stores {
      id
      __typename
    }
    __typename
  }
}

